import * as React from 'react';
import { Flex, Box, Text, Link } from 'rebass';

const Navbar = () => {
    return (
        <Flex
            px={2}
            color='white'
            bg='black'
            alignItems='center'>
            <Text p={2} fontWeight='bold'>
                Rebass
            </Text>
            <Box mx='auto' />
            <Link variant='nav' href='#!' style="color:white">
                Profile
            </Link>
        </Flex>
    )
}

export default Navbar;
